void drawPepsiman(int x_start, int y_start, int size){
    for(int x=x_start, i=0; x<x_start+100; x++, i++){
        for(int y=y_start, j=0; y<y_start+100; y++, j++){
            putpixelResizable(colormap[pepsiman[j][i]], x, y, size);
        }
    }
}








